  const bookings = variables['bookingsData'] || [];

  // Get filter values
  const searchTerm = variables['search_input-value'] || '';
  const statusFilter = variables['status_filter-value'] || '';
  const dateRange = variables['date_range_picker-value'] || null;

  // Apply filters
  return bookings.filter(booking => {
    // Search filter
    if (searchTerm && !booking.customerName.toLowerCase().includes(searchTerm.toLowerCase()) && 
        !booking.vehicleName.toLowerCase().includes(searchTerm.toLowerCase()) &&
        !booking.id.toLowerCase().includes(searchTerm.toLowerCase())) {
      return false;
    }

    // Status filter
    if (statusFilter && booking.status !== statusFilter) {
      return false;
    }

    // Date range filter
    if (dateRange && dateRange.start && dateRange.end) {
      const bookingStart = new Date(booking.startDate);
      const bookingEnd = new Date(booking.endDate);
      const filterStart = new Date(dateRange.start);
      const filterEnd = new Date(dateRange.end);

      // Check if booking dates overlap with filter dates
      if (bookingEnd < filterStart || bookingStart > filterEnd) {
        return false;
      }
    }

    return true;
  });

